import React from 'react'

function Index({people}) {
    let content = people.map(ele=>{
        return <div key={ele.id}>
                <li>{ele.name}</li>
               </div>
    })
  return (
    <div className='app'>
          <h1>Index</h1>
    <ul>
        {content}
    </ul>
    </div>
  )
}

export default Index
